import React from 'react';  
import Highcharts from 'highcharts'
import HighchartsReact from 'highcharts-react-official'
import './result.scss';
import { useQuestions } from '../questionsComponent/questions';

function Result() {

    const { votes } = useQuestions();



    const count = {};
    votes.forEach(function(i) { count[i] = (count[i]||0) + 1;});

    let xAxis = Object.values(count),
        yAxis = Object.keys(count),
        seperatedVotes = [xAxis, yAxis]

    console.log(Object.keys(count),Object.values(count))

    useEffect(() => {

        const config = {
            chart: {
                type: 'column',
                width: 500,
                height:500
            },
            title: {
                text: 'Vote Results'
            },
            xAxis: {
                categories: xAxis
            },
            series: seperatedVotes
        };

    })


    console.log(config)

    return <div className="result-wrapper">
        <HighchartsReact highcharts={Highcharts} constructorType={'chart'} options={config} />
    </div>
}


export default Result;
